INSERT INTO `cms` VALUES (4,'Privacy Policy','privacy-policy','<h1>Privacy Policy</h1>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">This Privacy Policy describes Our policies and procedures on the collection, use and disclosure of Your information when You use the Service and tells You about Your privacy rights and how the law protects You.</p>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">We use Your Personal data to provide and improve the Service. By using the Service, You agree to the collection and use of information in accordance with this Privacy Policy.</p>\r\n\r\n<h1>Interpretation and Definitions</h1>\r\n\r\n<h2 style=\"display:block;width:100%;\">Interpretation</h2>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">The words of which the initial letter is capitalized have meanings defined under the following conditions. The following definitions shall have the same meaning regardless of whether they appear in singular or in plural.</p>\r\n\r\n<h2>Definitions</h2>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">For the purposes of this Privacy Policy:</p>\r\n\r\n<ul style=\"list-style-type: disc;\">\r\n	<li style=\"margin: 0;\">\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\"><strong>Account</strong> means a unique account created for You to access our Service or parts of our Service.</p>\r\n	</li>\r\n	<li style=\"margin: 0;\">\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\"><strong>Affiliate</strong> means an entity that controls, is controlled by or is under common control with a party, where &quot;control&quot; means ownership of 50% or more of the shares, equity interest or other securities entitled to vote for election of directors or other managing authority.</p>\r\n	</li>\r\n	<li style=\"margin: 0;\">\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\"><strong>Application</strong> means the software program provided by the Company downloaded by You on any electronic device, named Mporeo.</p>\r\n	</li>\r\n	<li style=\"margin: 0;\">\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\"><strong>Cookies</strong> are small files that are placed on Your computer, mobile device or any other device by a website, containing the details of Your browsing history on that website among its many uses.</p>\r\n	</li>\r\n	<li style=\"margin: 0;\">\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\"><strong>Country</strong> refers to: United States Of America</p>\r\n	</li>\r\n	<li style=\"margin: 0;\">\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\"><strong>Device</strong> means any device that can access the Service such as a computer, a cellphone, a digital tablet, a digital touch display or a payment terminal.</p>\r\n	</li>\r\n	<li style=\"margin: 0;\">\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\"><strong>Personal Data</strong> is any information that relates to an identified or identifiable individual.</p>\r\n	</li>\r\n	<li style=\"margin: 0;\">\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\"><strong>Service</strong> refers to the Application or the Website or both.</p>\r\n	</li>\r\n	<li style=\"margin: 0;\">\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\"><strong>Service Provider</strong> means any natural or legal person who processes the data on behalf of the Company. It refers to third-party companies or individuals employed by the Company to facilitate the Service, to provide the Service on behalf of the Company, to perform services related to the Service or to assist the Company in analyzing how the Service is used.</p>\r\n	</li>\r\n	<li style=\"margin: 0;\">\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\"><strong>Third-party Social Media Service</strong> refers to any website or any social network website through which a User can log in or create an account to use the Service.</p>\r\n	</li>\r\n	<li style=\"margin: 0;\">\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\"><strong>Usage Data</strong> refers to data collected automatically, either generated by the use of the Service or from the Service infrastructure itself (for example, the duration of a page visit).</p>\r\n	</li>\r\n	<li style=\"margin: 0;\">\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\"><strong>Website</strong> refers to Mporeo, accessible from <a href=\"https://Mporeo.one.com/\" rel=\"external nofollow noopener\" target=\"_blank\">https://Mporeo.one</a></p>\r\n	</li>\r\n	<li style=\"margin: 0;\">\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\"><strong>You</strong> means the individual accessing or using the Service, or the company, or other legal entity on behalf of which such individual is accessing or using the Service, as applicable.</p>\r\n	</li>\r\n</ul>\r\n\r\n<h1>Collecting and Using Your Personal Data</h1>\r\n\r\n<h2 style=\"width: 100%;\">Types of Data Collected</h2>\r\n\r\n<h3>Tokenized Data</h3>\r\n\r\n<p>While using Our Service, We will send your personal private information to PCI DSS certified&nbsp;tokenization service providers to encrypt your data and return encrypted tokens for use in our system as secure data.&nbsp;<span style=\"color: rgb(77, 81, 86); font-family: Roboto, arial, sans-serif; text-align: left;\">The Payment Card Industry Data Security Standard (</span><span style=\"font-weight: bold; color: rgb(95, 99, 104); font-family: Roboto, arial, sans-serif; text-align: left;\">PCI DSS</span><span style=\"color: rgb(77, 81, 86); font-family: Roboto, arial, sans-serif; text-align: left;\">) was developed to encourage and enhance payment card account data security.</span></p>\r\n\r\n<p>ENCRYPTION (or cryptography) makes card data unreadable to people without special information (called a key). Cryptography can be used on stored data and data transmitted over a network.&nbsp;</p>\r\n\r\n<h3>Personal Data</h3>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">While using Our Service, We may ask You to provide Us with certain personally identifiable information that can be used to contact or identify You. Personally identifiable information may include, but is not limited to:</p>\r\n\r\n<ul style=\"list-style-type: disc;\">\r\n	<li style=\"margin: 0;\">\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\">Email address</p>\r\n	</li>\r\n	<li style=\"margin: 0;\">\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\">First name and last name</p>\r\n	</li>\r\n	<li style=\"margin: 0;\">\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\">Phone number</p>\r\n	</li>\r\n	<li style=\"margin: 0;\">\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\">Address, State, Province, ZIP/Postal code, City</p>\r\n	</li>\r\n	<li style=\"margin: 0;\">\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\">Usage Data</p>\r\n	</li>\r\n</ul>\r\n\r\n<h3 style=\"width: 100%;\">Usage Data</h3>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">Usage Data is collected automatically when using the Service.</p>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">Usage Data may include information such as Your Device&#39;s Internet Protocol address (e.g. IP address), browser type, browser version, the pages of our Service that You visit, the time and date of Your visit, the time spent on those pages, unique device identifiers and other diagnostic data.</p>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">When You access the Service by or through a mobile device, We may collect certain information automatically, including, but not limited to, the type of mobile device You use, Your mobile device unique ID, the IP address of Your mobile device, Your mobile operating system, the type of mobile Internet browser You use, unique device identifiers and other diagnostic data.</p>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">We may also collect information that Your browser sends whenever You visit our Service or when You access the Service by or through a mobile device.</p>\r\n\r\n<h3>Information from Third-Party Social Media Services</h3>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">The Company allows You to create an account and log in to use the Service through the following Third-party Social Media Services:</p>\r\n\r\n<ul style=\"list-style-type: disc;\">\r\n	<li style=\"margin: 0;\">Google</li>\r\n	<li style=\"margin: 0;\">Meta</li>\r\n</ul>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">If You decide to register through or otherwise grant us access to a Third-Party Social Media Service, We may collect Personal data that is already associated with Your Third-Party Social Media Service&#39;s account, such as Your name, Your email address, Your activities or Your contact list associated with that account.</p>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">You may also have the option of sharing additional information with the Company through Your Third-Party Social Media Service&#39;s account. If You choose to provide such information and Personal Data, during registration or otherwise, You are giving the Company permission to use, share, and store it in a manner consistent with this Privacy Policy.</p>\r\n\r\n<h3>Information Collected while Using the Application</h3>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">While using Our Application, in order to provide features of Our Application, We may collect, with Your prior permission:</p>\r\n\r\n<ul style=\"list-style-type: disc;\">\r\n	<li style=\"margin: 0;\">\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\">Information regarding your location</p>\r\n	</li>\r\n	<li style=\"margin: 0;\">\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\">Pictures and other information from your Device&#39;s camera and photo library</p>\r\n	</li>\r\n</ul>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">We use this information to provide features of Our Service, to improve and customize Our Service. The information may be uploaded to the Company&#39;s servers and/or a Service Provider&#39;s server or it may be simply stored on Your device.</p>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">You can enable or disable access to this information at any time, through Your Device settings.</p>\r\n\r\n<h3>Tracking Technologies and Cookies</h3>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">We use Cookies and similar tracking technologies to track the activity on Our Service and store certain information. Tracking technologies used are beacons, tags, and scripts to collect and track information and to improve and analyze Our Service. The technologies We use may include:</p>\r\n\r\n<ul style=\"list-style-type: disc;\">\r\n	<li style=\"margin: 0;\"><strong>Cookies or Browser Cookies.</strong> A cookie is a small file placed on Your Device. You can instruct Your browser to refuse all Cookies or to indicate when a Cookie is being sent. However, if You do not accept Cookies, You may not be able to use some parts of our Service. Unless you have adjusted Your browser setting so that it will refuse Cookies, our Service may use Cookies.</li>\r\n	<li style=\"margin: 0;\"><strong>Flash Cookies.</strong> Certain features of our Service may use local stored objects (or Flash Cookies) to collect and store information about Your preferences or Your activity on our Service. Flash Cookies are not managed by the same browser settings as those used for Browser Cookies. For more information on how You can delete Flash Cookies, please read &quot;Where can I change the settings for disabling, or deleting local shared objects?&quot; available at <a href=\"https://helpx.adobe.com/flash-player/kb/disable-local-shared-objects-flash.html#main_Where_can_I_change_the_settings_for_disabling__or_deleting_local_shared_objects_\" rel=\"external nofollow noopener\" target=\"_blank\">https://helpx.adobe.com/flash-player/kb/disable-local-shared-objects-flash.html#main_Where_can_I_change_the_settings_for_disabling__or_deleting_local_shared_objects_</a></li>\r\n	<li style=\"margin: 0;\"><strong>Web Beacons.</strong> Certain sections of our Service and our emails may contain small electronic files known as web beacons (also referred to as clear gifs, pixel tags, and single-pixel gifs) that permit the Company, for example, to count users who have visited those pages or opened an email and for other related website statistics (for example, recording the popularity of a certain section and verifying system and server integrity).</li>\r\n</ul>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">Cookies can be &quot;Persistent&quot; or &quot;Session&quot; Cookies. Persistent Cookies remain on Your personal computer or mobile device when You go offline, while Session Cookies are deleted as soon as You close Your web browser.</p>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">We use both Session and Persistent Cookies for the purposes set out below:</p>\r\n\r\n<ul style=\"list-style-type: disc;\">\r\n	<li style=\"margin: 0;\">\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\"><strong>Necessary / Essential Cookies</strong></p>\r\n\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\">Type: Session Cookies</p>\r\n\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\">Administered by: Us</p>\r\n\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\">Purpose: These Cookies are essential to provide You with services available through the Website and to enable You to use some of its features. They help to authenticate users and prevent fraudulent use of user accounts. Without these Cookies, the services that You have asked for cannot be provided, and We only use these Cookies to provide You with those services.</p>\r\n	</li>\r\n	<li style=\"margin: 0;\">\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\"><strong>Cookies Policy / Notice Acceptance Cookies</strong></p>\r\n\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\">Type: Persistent Cookies</p>\r\n\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\">Administered by: Us</p>\r\n\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\">Purpose: These Cookies identify if users have accepted the use of cookies on the Website.</p>\r\n	</li>\r\n	<li style=\"margin: 0;\">\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\"><strong>Functionality Cookies</strong></p>\r\n\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\">Type: Persistent Cookies</p>\r\n\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\">Administered by: Us</p>\r\n\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\">Purpose: These Cookies allow us to remember choices You make when You use the Website, such as remembering your login details or language preference. The purpose of these Cookies is to provide You with a more personal experience and to avoid You having to re-enter your preferences every time You use the Website.</p>\r\n	</li>\r\n</ul>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">For more information about the cookies we use and your choices regarding cookies, please visit our Cookies Policy or the Cookies section of our Privacy Policy.</p>\r\n\r\n<h2>Use of Your Personal Data</h2>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">The Company may use Personal Data for the following purposes:</p>\r\n\r\n<ul style=\"list-style-type: disc;\">\r\n	<li style=\"margin: 0;\">\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\"><strong>To provide and maintain our Service</strong>, including to monitor the usage of our Service.</p>\r\n	</li>\r\n	<li style=\"margin: 0;\">\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\"><strong>To manage Your Account:</strong> to manage Your registration as a user of the Service. The Personal Data You provide can give You access to different functionalities of the Service that are available to You as a registered user.</p>\r\n	</li>\r\n	<li style=\"margin: 0;\">\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\"><strong>For the performance of a contract:</strong> the development, compliance and undertaking of the purchase contract for the products, items or services You have purchased or of any other contract with Us through the Service.</p>\r\n	</li>\r\n	<li style=\"margin: 0;\">\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\"><strong>To contact You:</strong> To contact You by email, telephone calls, SMS, or other equivalent forms of electronic communication, such as a mobile application&#39;s push notifications regarding updates or informative communications related to the functionalities, products or contracted services, including the security updates, when necessary or reasonable for their implementation.</p>\r\n	</li>\r\n	<li style=\"margin: 0;\">\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\"><strong>To provide You</strong> with news, special offers and general information about other goods, services and events which we offer that are similar to those that you have already purchased or enquired about unless You have opted not to receive such information.</p>\r\n	</li>\r\n	<li style=\"margin: 0;\">\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\"><strong>To manage Your requests:</strong> To attend and manage Your requests to Us.</p>\r\n	</li>\r\n	<li style=\"margin: 0;\">\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\"><strong>For business transfers:</strong> We may use Your information to evaluate or conduct a merger, divestiture, restructuring, reorganization, dissolution, or other sale or transfer of some or all of Our assets, whether as a going concern or as part of bankruptcy, liquidation, or similar proceeding, in which Personal Data held by Us about our Service users is among the assets transferred.</p>\r\n	</li>\r\n	<li style=\"margin: 0;\">\r\n	<p style=\"line-height: 2; padding: 0; margin: 0;\"><strong>For other purposes</strong>: We may use Your information for other purposes, such as data analysis, identifying usage trends, determining the effectiveness of our promotional campaigns and to evaluate and improve our Service, products, services, marketing and your experience.</p>\r\n	</li>\r\n</ul>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">We may share Your personal information in the following situations:</p>\r\n\r\n<ul style=\"list-style-type: disc;\">\r\n	<li style=\"margin: 0;\"><strong>With Service Providers:</strong> We may share Your personal information with Service Providers to monitor and analyze the use of our Service, to contact You.</li>\r\n	<li style=\"margin: 0;\"><strong>For business transfers:</strong> We may share or transfer Your personal information in connection with, or during negotiations of, any merger, sale of Company assets, financing, or acquisition of all or a portion of Our business to another company.</li>\r\n	<li style=\"margin: 0;\"><strong>With Affiliates:</strong> We may share Your information with Our affiliates, in which case we will require those affiliates to honor this Privacy Policy. Affiliates include Our parent company and any other subsidiaries, joint venture partners or other companies that We control or that are under common control with Us.</li>\r\n	<li style=\"margin: 0;\"><strong>With business partners:</strong> We may share Your information with Our business partners to offer You certain products, services or promotions.</li>\r\n	<li style=\"margin: 0;\"><strong>With other users:</strong> when You share personal information or otherwise interact in the public areas with other users, such information may be viewed by all users and may be publicly distributed outside. If You interact with other users or register through a Third-Party Social Media Service, Your contacts on the Third-Party Social Media Service may see Your name, profile, pictures and description of Your activity. Similarly, other users will be able to view descriptions of Your activity, communicate with You and view Your profile.</li>\r\n	<li style=\"margin: 0;\"><strong>With Your consent</strong>: We may disclose Your personal information for any other purpose with Your consent.</li>\r\n</ul>\r\n\r\n<h2>Retention of Your Personal Data</h2>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">The Company will retain Your Personal Data as encrypted TOKENS only for as long as is necessary for the purposes set out in this Privacy Policy. We will retain and use Your Personal Data to the extent necessary to comply with our legal obligations (for example, if we are required to retain your data to comply with applicable laws), resolve disputes, and enforce our legal agreements and policies.</p>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">The Company will also retain Usage Data for internal analysis purposes. Usage Data is generally retained for a shorter period of time, except when this data is used to strengthen the security or to improve the functionality of Our Service, or We are legally obligated to retain this data for longer time periods.</p>\r\n\r\n<h2>Transfer of Your Personal Data</h2>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">Your information, including Personal Data, is processed at the Company&#39;s Secure AWS Servers and in any other place where the parties involved in the processing are located. It means that this information may be transferred to Tokenization service providers and maintained on encrypted secure computers located outside of Your state, province, country or other governmental jurisdiction where the data protection laws may differ than those from Your jurisdiction.</p>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">Your consent to this Privacy Policy followed by Your submission of such information represents Your agreement to that transfer.</p>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">The Company will take all steps reasonably necessary to ensure that Your data is treated securely and in accordance with this Privacy Policy and no transfer of Your Personal Data will take place to an organization or a country unless there are adequate controls in place including the security of Your data and other personal information.</p>\r\n\r\n<h2>Disclosure of Your Personal Data</h2>\r\n\r\n<h3>Business Transactions</h3>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">If the Company is involved in a merger, acquisition or asset sale, Your Personal Data may be transferred. We will provide notice before Your Personal Data is transferred and becomes subject to a different Privacy Policy.</p>\r\n\r\n<h3>Law enforcement</h3>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">Under certain circumstances, the Company may be required to disclose Your Personal Data if required to do so by law or in response to valid requests by public authorities (e.g. a court or a government agency).</p>\r\n\r\n<h3>Other legal requirements</h3>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">The Company may disclose Your Personal Data in the good faith belief that such action is necessary to:</p>\r\n\r\n<ul style=\"list-style-type: disc;\">\r\n	<li style=\"margin: 0;\">Comply with a legal obligation</li>\r\n	<li style=\"margin: 0;\">Protect and defend the rights or property of the Company</li>\r\n	<li style=\"margin: 0;\">Prevent or investigate possible wrongdoing in connection with the Service</li>\r\n	<li style=\"margin: 0;\">Protect the personal safety of Users of the Service or the public</li>\r\n	<li style=\"margin: 0;\">Protect against legal liability</li>\r\n</ul>\r\n\r\n<h2 style=\"display:block;width:100%;\">Security of Your Personal Data</h2>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">The security of Your Personal Data is important to Us, but remember that no method of transmission over the Internet, or method of electronic storage is 100% secure. While We strive to use commercially acceptable means to protect Your Personal Data, We cannot guarantee its absolute security.</p>\r\n\r\n<h1>Children&#39;s Privacy</h1>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">Our Service does not address anyone under the age of 13. We do not knowingly collect personally identifiable information from anyone under the age of 13. If You are a parent or guardian and You are aware that Your child has provided Us with Personal Data, please contact Us. If We become aware that We have collected Personal Data from anyone under the age of 13 without verification of parental consent, We take steps to remove that information from Our servers.</p>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">If We need to rely on consent as a legal basis for processing Your information and Your country requires consent from a parent, We may require Your parent&#39;s consent before We collect and use that information.</p>\r\n\r\n<h1>Links to Other Websites</h1>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">Our Service may contain links to other websites that are not operated by Us. If You click on a third party link, You will be directed to that third party&#39;s site. We strongly advise You to review the Privacy Policy of every site You visit.</p>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">We have no control over and assume no responsibility for the content, privacy policies or practices of any third party sites or services.</p>\r\n\r\n<h1>Changes to this Privacy Policy</h1>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">We may update Our Privacy Policy from time to time. We will notify You of any changes by posting the new Privacy Policy on this page.</p>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">We will let You know via email and/or a prominent notice on Our Service, prior to the change becoming effective and update the &quot;Last updated&quot; date at the top of this Privacy Policy.</p>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">You are advised to review this Privacy Policy periodically for any changes. Changes to this Privacy Policy are effective when they are posted on this page.</p>\r\n\r\n<h1>Facebook Data Collection and Usage<b>&nbsp;</b></h1>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 17px; color: rgb(22, 18, 18); line-height: 40px; padding: 0px 15px; width: 1540px; font-family: &quot;Cera Pro&quot;; text-align: left;\">When a user want&#39;s to register/login to our platform using facebook login, we collect 2 data entities from facebook.&nbsp;</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 17px; color: rgb(22, 18, 18); line-height: 40px; padding: 0px 15px; width: 1540px; font-family: &quot;Cera Pro&quot;; text-align: left;\"><span style=\"box-sizing: border-box; font-weight: bolder;\">public_profile</span>&nbsp;: We use public informations shared by a facebook user like first name. last name and profile picture, these are required for customer account management.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 17px; color: rgb(22, 18, 18); line-height: 40px; padding: 0px 15px; width: 1540px; font-family: &quot;Cera Pro&quot;; text-align: left;\"><span style=\"box-sizing: border-box; font-weight: bolder;\">email</span>&nbsp;: User&#39;s email address is collected, which is required for account management. This is also required for order management process.</p>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 17px; color: rgb(22, 18, 18); line-height: 40px; padding: 0px 15px; width: 1540px; font-family: &quot;Cera Pro&quot;; text-align: left;\">&nbsp;</p>\r\n\r\n<h1>&nbsp;Data Deletion Request</h1>\r\n\r\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; font-size: 17px; color: rgb(22, 18, 18); line-height: 40px; padding: 0px 15px; width: 1540px; font-family: &quot;Cera Pro&quot;; text-align: left;\">We at Mporeo take utmost safety while handling user data. However incase if any user want to delete their account or any of their data collected by us, they can reach us anytime using the contact details provided at the very end of current page and we will do the same requested by the user. Also we do provide account deletion option at our platform which can be used by the user to delete their account themselves</p>\r\n\r\n<h1>Contact Us</h1>\r\n\r\n<p style=\"line-height: 2; padding: 0; margin: 0;\">If you have any questions about this Privacy Policy, You can contact us:</p>\r\n\r\n<ul style=\"list-style-type: disc;\">\r\n	<li style=\"margin: 0;\">By email: support@mporeo.systems</li>\r\n</ul>','cms/df7038ee8b791365b502f35a3656a6f4.jpg','cms/bacf6717b00113badeff6863e707f48c.png',162,'en',1,1,1,'2023-02-06 12:05:51',NULL,'Privacy Policy','Privacy Policy'),(5,'Terms and Conditions','terms-and-conditions','<p class=\"p1\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: Helvetica; -webkit-text-stroke-color: rgb(38, 38, 38); margin: 0px 0px 14px; color: rgb(38, 38, 38);\"><span class=\"s1\" style=\"font-kerning: none;\"><b>Mporeo Restaurant</b> is available for the usage of the end user for no cost at all. By choosing to use our service, you agree to our Privacy Policy.</span></p>\r\n\r\n<p class=\"p1\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: Helvetica; -webkit-text-stroke-color: rgb(38, 38, 38); margin: 0px 0px 14px; color: rgb(38, 38, 38);\"><span class=\"s1\" style=\"font-kerning: none;\">This page intends to provide our visitors with information regarding our policies on the collection, use, and disclosure of their personal information, in case they decide to use our service. All the information collected by us is used to provide and improve our service. Your personal information will not be used or shared with any third party, except as described in this Privacy Policy.</span></p>\r\n\r\n<p class=\"p1\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: Helvetica; -webkit-text-stroke-color: rgb(38, 38, 38); margin: 0px 0px 14px; color: rgb(38, 38, 38);\"><span class=\"s1\" style=\"font-kerning: none;\">The terms used in this privacy policy have the same meanings as in our Terms and Conditions, which is accessible at Mporeo unless otherwise defined in this Privacy Policy.</span></p>\r\n\r\n<h2 class=\"p1\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: Helvetica; -webkit-text-stroke-color: rgb(38, 38, 38); margin: 0px 0px 14px; color: rgb(38, 38, 38);\"><span class=\"s1\" style=\"font-kerning: none; font-size: calc(14px + 6 * ((100vw - 300px) / (1920 - 300)));\"><b>Information Collection and Use</b></span></h2>\r\n\r\n<p class=\"p1\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: Helvetica; -webkit-text-stroke-color: rgb(38, 38, 38); margin: 0px 0px 14px; color: rgb(38, 38, 38);\"><span class=\"s1\" style=\"font-kerning: none;\">To provide you with a great user experience, while using our service, we may ask you to provide us with your personal information. The information collected will be retained by us and will be used only as stated in this privacy policy.</span></p>\r\n\r\n<p class=\"p1\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: Helvetica; -webkit-text-stroke-color: rgb(38, 38, 38); margin: 0px 0px 14px; color: rgb(38, 38, 38);\"><span class=\"s1\" style=\"font-kerning: none;\">Mporeo also uses third-party services which may collect your personal information and use it for your identification.</span></p>\r\n\r\n<p class=\"p1\" style=\"font-variant-numeric: normal; font-variant-east-asian: n