ersonal data. They collect and use your information to perform the various tasks assigned to them, on our behalf. However, they are obligated not to use this information for any other purpose, and not to disclose it with others.</span></p>\r\n\r\n<h2 class=\"p1\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: Helvetica; -webkit-text-stroke-color: rgb(38, 38, 38); margin: 0px 0px 14px; color: rgb(38, 38, 38);\"><span class=\"s1\" style=\"font-kerning: none; font-size: calc(14px + 6 * ((100vw - 300px) / (1920 - 300))); \"><b>Security</b></span></h2>\r\n\r\n<p class=\"p1\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: Helvetica; -webkit-text-stroke-color: rgb(38, 38, 38); margin: 0px 0px 14px; color: rgb(38, 38, 38);\"><span class=\"s1\" style=\"font-kerning: none;\">We appreciate and value the level of trust you put in us by providing your personal information and therefore we are determined to use the best commercially acceptable means to protect it. But there is no mode of transmission on the internet or electronic storage that is 100% safe, secure and reliable, and we cannot guarantee its absolute security.</span></p>\r\n\r\n<h2 class=\"p1\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: Helvetica; -webkit-text-stroke-color: rgb(38, 38, 38); margin: 0px 0px 14px; color: rgb(38, 38, 38);\"><span class=\"s1\" style=\"font-kerning: none; font-size: calc(14px + 6 * ((100vw - 300px) / (1920 - 300)));\"><b>Links to Other Sites</b></span></h2>\r\n\r\n<p class=\"p1\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: Helvetica; -webkit-text-stroke-color: rgb(38, 38, 38); margin: 0px 0px 14px; color: rgb(38, 38, 38);\"><span class=\"s1\" style=\"font-kerning: none;\">Our application contains links to other sites. By clicking on these link you will be navigated to their site. These external sites are not operated by us and therefore we strongly recommend you to review their privacy policies. We do not control those sites and accept no responsibility for the content, privacy policies, or practices of any such third-party sites.</span></p>\r\n\r\n<h2 class=\"p1\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: Helvetica; -webkit-text-stroke-color: rgb(38, 38, 38); margin: 0px 0px 14px; color: rgb(38, 38, 38);\"><span class=\"s1\" style=\"font-kerning: none; font-size: calc(14px + 6 * ((100vw - 300px) / (1920 - 300)));\"><b>Children&rsquo;s Privacy</b></span></h2>\r\n\r\n<p class=\"p1\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: Helvetica; -webkit-text-stroke-color: rgb(38, 38, 38); margin: 0px 0px 14px; color: rgb(38, 38, 38);\"><span class=\"s1\" style=\"font-kerning: none;\">Our services do not address anyone below the age of thirteen. We do not collect any kind of personally identifiable data from children below the age of thirteen. If we find out that a child under the age of 13 has provided us with some personal data, we take immediate action to remove it from our servers.&nbsp;</span></p>\r\n\r\n<p class=\"p1\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-family: Helvetica; -webkit-text-stroke-color: rgb(38, 38, 38); margin: 0px 0px 14px; color: rgb(38, 38, 38);\"><span class=\"s1\" style=\"font-kerning: none;\">If your child has accidentally provided us with personal information, kindly contact us so that we can take all the necessary steps to remove it.</span></p>\r\n\r\n<h2 class=\"p1\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-he