fc9a5e978532028659626.png',161,'en',1,1,1,'2023-01-24 02:48:40',NULL,'Contact Us',''),(7,'About Us','about-us','<p><strong>MPOREO&nbsp;</strong>is available for the usage of the end user for no cost at all. By choosing to use our service, you agree to our Privacy Policy.</p>\r\n\r\n<p>This page intends to provide our visitors with information regarding our policies on the collection, use, and disclosure of their personal information, in case they decide to use our service. All the information collected by us is used to provide and improve our service. Your personal information will not be used or shared with any third party, except as described in this Privacy Policy.</p>\r\n\r\n<p>The terms used in this privacy policy have the same meanings as in our Terms and Conditions, which is accessible at Mporeo unless otherwise defined in this Privacy Policy.</p>\r\n\r\n<h2 style=\"font-size: calc(14px + 6 * ((100vw - 300px) / (1920 - 300)));\"><strong>Information Collection and Use</strong></h2>\r\n\r\n<p>To provide you with a great user experience, while using our service, we may ask you to provide us with your personal information. The information collected will be retained by us and will be used only as stated in this privacy policy.</p>\r\n\r\n<p>MPOREO also uses third-party services which may collect your personal information and use it for your identification.</p>\r\n\r\n<p>Please find below the link to the privacy policy of our third-party service provider:<br />\r\nGoogle Play Services&nbsp;</p>\r\n\r\n<h2 style=\"font-size: calc(14px + 6 * ((100vw - 300px) / (1920 - 300)));\"><strong>Log Data</strong></h2>\r\n\r\n<p>While using our services if an unexpected error occurs, we collect data (through third-party products) from your phone which is known as &lsquo;Log Data.&rsquo; The collected data may include information like your IP address, the name of your device, operating system version, the time and date when the service is used, the configuration of the app when utilizing our Service, and the configuration of the application while utilizing our service and other such statistics.</p>\r\n\r\n<h2 style=\"font-size: calc(14px + 6 * ((100vw - 300px) / (1920 - 300)));\"><strong>Cookies</strong></h2>\r\n\r\n<p>Cookies are archives stored on your device with the small amount of information about the user and the website, it can be used as anonymous unique identifiers. These archives are sent to your browser from the websites visited by you and are stored on the internal memory of your device.</p>\r\n\r\n<p>Mporeo does not use these cookies explicitly. However, it does uses third-party codes and libraries, which may use cookies to gather information to improve their service and user experience. You can choose to accept or decline these cookies and be in control of when and how these cookies are being used. If you refuse to use cookies by Mporeo, you might not be able to use some parts of the service.</p>\r\n\r\n<h2 style=\"font-size: calc(14px + 6 * ((100vw - 300px) / (1920 - 300)));\"><strong>Service Providers</strong></h2>\r\n\r\n<p>We may utilize third-party companies for the following:</p>\r\n\r\n<ul>\r\n	<li>To secure your personal data by way of TOKENIZATION. Your private information is encrypted and stored in our servers as tokens.</li>\r\n	<li>To Perform compliance functions pertaining to PCI DSS.&nbsp;</li>\r\n	<li>To deliver the service on behalf of us</li>\r\n	<li>To execute related services</li>\r\n	<li>To support us in evaluating how our service is being used.</li>\r\n</ul>\r\n\r\n<p>We want our users to be well informed that these third-parties have access to your personal data. They collect and use your information to perform the various tasks assigned to them, on our behalf. However, they are obligated not to use this information for any other purpose, and not to disclose it with others.</p>\r\n\r\n<h2 style=\"font-size: calc(14px + 6 * ((100vw - 300px) / (1920 - 300)));\"><strong>Security</strong></h2>\r\n\r\n<p>We appreciate and value the level of trust you put in us by providing your personal information and therefore we are determined to use the best commercially acceptable means to protect it. But there is no mode of transmission on the internet or electronic storage that is 100% safe, secure and reliable, and we cannot guarantee its absolute security.</p>\r\n\r\n<h2 style=\"font-size: calc(14px + 6 * ((100vw - 300px) / (1920 - 300)));\"><strong>Links to Other Sites</strong></h2>\r\n\r\n<p>Our application contains links to other sites. By clicking on these link you will be navigated to their site. These external sites are not operated by us and therefore we strongly recommend you to review their privacy policies. We do not control those sites and accept no responsibility for the content, privacy policies, or practices of any such third-party sites.</p>\r\n\r\n<h2 style=\"font-size: calc(14px + 6 * ((100vw - 300px) / (1920 - 300)));\"><strong>Children&rsquo;s Privacy</strong></h2>\r\n\r\n<p>Our services do not address anyone below the age of thirteen. We do not collect any kind of personally identifiable data from children below the age of thirteen. If we find out that a child under the age of 13 has provided us with some personal data, we take immediate action to remove it from our servers.&nbsp;</p>\r\n\r\n<p>If your child has accidentally provided us with personal information, kindly contact us so that we can take all the necessary steps to remove it.</p>\r\n\r\n<h2 style=\"font-size: calc(14px + 6 * ((100vw - 300px) / (1920 - 300)));\"><strong>Changes to This Privacy Policy</strong></h2>\r\n\r\n<p>We may update our privacy policy at times. We advise you to review this page at regular intervals to stay informed. In case of any changes in our privacy policy, we will notify you by updating it on this page. Such changes would effective immediately after being posted here.</p>\r\n\r\n<h2 style=\"font-size: calc(14px + 6 * ((100vw - 300px) / (1920 - 300)));\"><strong>Contact Us</strong></h2>\r\n\r\n<p>Please feel free to contact us for any question or suggestions regarding our privacy policy.</p>\r\n\r\n<p>Email:&nbsp;<span style=\"font-family: &quot;Open Sans&quot;, Arial, Helvetica, sans-serif; font-size: 16px; font-weight: 600; text-align: start; white-space: nowrap;\">notify@mporeo.systems</span></p>','cms/9cd908512e53cbb1d0bedb512b936604.jpg','cms/da306b0acc6e89d9233bf990cced8ceb.jpg',160,'en',1,1,1,'2023-01-21 02:01:15',NULL,'About Us','About Us');
