  `login_type` enum('normal','facebook','google') DEFAULT NULL,
  `social_media_id` varchar(255) DEFAULT NULL,
  `status` tinyint NOT NULL DEFAULT '0' COMMENT '1- active',
  `availability_status` tinyint NOT NULL DEFAULT '0' COMMENT '1: online, 0: offline ',
  `active` tinyint DEFAULT NULL COMMENT '1- active',
