  `language_slug` varchar(10) DEFAULT NULL,
  `driver_temperature` varchar(255) DEFAULT NULL,
  `active_code` varchar(255) DEFAULT NULL,
  `referral_code` varchar(255) DEFAULT NULL,
  `referral_code_used` varchar(255) DEFAULT NULL,
